/** @param {NS} ns */
export async function main(ns) {
  let keyFrames = [];

  for (let i = 0; i <= 286; i++) {
    keyFrames.push("keyFrame" + i);
  }

  while (true) {
    for (let keyFrame in keyFrames) {
      ns.ui.clearTerminal();
      ns.tprint("frame: " + keyFrame)
      eval(keyFrames[keyFrame] + "(ns)");
      await (ns.sleep(62));
    }
  }
}

